import { FlexCol, H1, LoanStepper } from "../../components";

export const LoanApplication = () => {
  const steps = [
    {
      name: "personal-details",
      label: "Personal Details",
      component: <></>,
    },
    {
      name: "loan-details",
      label: "Loan Details",
      component: <></>,
    },
    {
      name: "suggestions",
      label: "Loan Suggestions",
      component: <></>,
    },
  ];

  const handleSubmit = () => {};
  return (
    <FlexCol gap={2}>
      <H1>Apply For Loan</H1>
      <LoanStepper steps={steps} onSubmit={handleSubmit} alternativeLabel />
    </FlexCol>
  );
};
